INSERT INTO xm_complaints VALUES ('1209', '产品投诉', '0', '881', '829', '佳能 PowerShot A640 如何看电量', '2012-06-11', '10:30', '非常紧急', '处理完成', '一小时', 'A640不能对剩余电量做数量显示，不能像手机那样，告诉还剩三格还是两格电，只是在电池快用完时，会出现一个闪烁的红色电池图形，表示剩下的电已经很少了，紧接着就会提示“更换电池”，如果你继续拍下去，镜头就会缩回，并自动关机。', '问题已经解决', '', '', '', '1', '31', '1', '0', '2012-06-11 15:14:27', '2012-06-15 14:47:43', '0', '0', '0');
