INSERT INTO xm_complaints VALUES ('1332', '产品投诉', '0', '894', '858', 'SONY-DSC-T30如何删除全部照片', '2012-06-12', '03:00', '普通', '处理完成', '请选择', '1、相机有“全部删除”选项，按向导操作即可；\r\n2、将存储卡在相机上格式化（推荐）；\r\n3、将卡取出，通过读卡器用电脑删除或格式化（装入相机后，再用相机格式化一下。有些相机有这样的要求，否则影响拍照或录像）。', '问题解决，服务很好。', '', '', '', '1', '30', '1', '0', '2012-06-12 14:11:18', '2012-06-15 14:47:22', '0', '0', '0');
