INSERT INTO xm_duishous VALUES ('1436', '功能上有绝对的优势，性价比高。', '三星笔记本电脑，价格相近，但是功能更为全面。一定程度上会降价促销。', 'TCL集团股份有限公司是全球性规模经营的消费类电子企业集团之一。旗下拥有三家上市公司：TCL集团、TCL多媒体科技、TCL通讯科技。目前已形成多媒体、通讯、华星光电和TCL家电四大产业集团，以及系统科技事业本部、泰科立集团等六大业务板块。', 'TCL集团股份有限公司', '价格偏高', '强', '价格比价高，对于只追求价格的客户群没有优势。', '1.降价促销\r\n2.质保延期\r\n3.配件赠送', '1', '1', '0', '0', '2012-06-14 16:01:27', '2012-06-14 16:01:27', '0', '0', '0');
INSERT INTO xm_duishous VALUES ('1437', '性价比更高，而且售后服务中心网店分布各个城市。', '联想笔记本电脑，增加售后服务中心。', '企业服务指挥中心，同样位于厦门，负责为拥有大规模计算机网络的客户提供快速支持服务。\r\n位于上海的中国设计中心，是戴尔在美国之外的全球最大的产品设计中心之一。\r\n位于大连的戴尔国际服务中心，负责为日本和韩国客户提供服务。', '戴尔(中国)有限公司', '价格一般', '强', '两者价格相比差不多，但是作为国外产品，消费者认为品质更有保证。', '促销活动赠送质保延期，媒体活动，网站广告招商等。', '1', '1', '1', '0', '2012-06-14 16:11:35', '2012-06-14 16:12:08', '0', '0', '0');
INSERT INTO xm_duishous VALUES ('1438', '性价比高，同等价位的配置有绝对优势。', '宏基笔记本电脑', '', '索尼(中国)有限公司 ', '价格略贵', '一般', '颜色鲜艳，外形美观，携带轻便。', '突出同等价位可以享受到的不一样的服务。', '1', '1', '0', '0', '2012-06-14 16:23:51', '2012-06-14 16:23:51', '0', '0', '0');
