INSERT INTO xm_faq VALUES ('1067', '923', '关闭触摸板，显示器上为什么不提示？', '没有安装ShowEasy-Win7驱动，安装后问题就可以解决。', '', '已审阅', 'H5', '触摸板', '4', 'FAQ20120606-001', '1', '0', '1', '0', '', '2012-06-06 15:57:20', '2012-06-06 16:03:08', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1070', '923', '独立显卡怎么切换？', '1.进入BIOS进行调整<br />\r\n2.在玩游戏或者机子集成显卡带不动的时候智能切换（自动的机子自己切换）', '', '已审阅', 'H5', '独立显卡', '1', 'FAQ20120606-002', '1', '0', '0', '0', '', '2012-06-06 16:02:55', '2012-06-06 16:02:55', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1071', '923', 'x46Hi7如何装双系统？', '先进BIOS把硬盘模式改成IDE装插P，装完XP后再装win7。', '', '已审阅', 'H5', '双系统', '1', 'FAQ20120606-003', '1', '0', '0', '0', '', '2012-06-06 16:06:33', '2012-06-06 16:06:33', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1072', '934', '佳能PowerShot A640 如何使夜间拍摄效果更好?？', '<pre id=\"best-answer-content\" class=\"reply-text mb10\">\r\n可以试着用手动功能。把闪光灯关了，手动调成屏幕亮起来。由于是晚上，曝光时间一定要长一些。这就不能避免的出现虚影。那就使用三脚架。\r\n</pre>', '', '已审阅', 'H6', '佳能PowerShot A640 ', '2', 'FAQ20120606-004', '1', '0', '1', '0', '', '2012-06-06 16:09:43', '2012-06-06 16:09:48', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1073', '934', '佳能 PowerShot A640 怎么看还有多少电?', '<pre class=\"reply-text mb10\" id=\"best-answer-content\">\r\nA640不能对剩余电量做数量显示，不能像手机那样，告诉还剩三格还是两格电，只是在电池快用完时，会出现一个闪烁的红色电池图形，表示剩下的电已经很少了，紧接着就会提示&ldquo;更换电池&rdquo;，如果你继续拍下去，镜头就会缩回，并自动关机。</pre>', '', '已审阅', 'H6', '佳能 PowerShot A640', '3', 'FAQ20120606-005', '1', '0', '0', '0', '', '2012-06-06 16:10:36', '2012-06-06 16:10:36', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1089', '916', '联想V370A-IFI使用时候的为什么CPU温度过高？', '1.笔记本的CPU温度看是没有优化系统导致的温度较高。<br />\r\n2.使用的时候不要放在散热效果不好的地方。<br />', '', '草稿', 'H5', '联想V370A-IFI', '3', 'FAQ20120606-006', '1', '0', '0', '0', '', '2012-06-06 17:01:57', '2012-06-06 17:01:57', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1210', '920', '华硕A43EI245SD-SL集显的笔记本能升级到独显吗？', '不能，A43带独显的都是焊在主板上的，集显的能有插槽吗，而且集显的散热设计不同，没有显卡散热模块也无法升级。', '', '已审阅', 'H5', '华硕A43EI245SD-SL', '2', 'FAQ20120611-007', '1', '0', '1', '0', '', '2012-06-11 15:20:20', '2012-06-11 15:20:25', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1211', '920', '华硕A43EI245SD-SL经常掉线是什么原因 ？', '宽带上网经常掉线，进行测试，查看是否是modem的问题。', '', '已审阅', 'H5', '华硕A43EI245SD-SL', '3', 'FAQ20120611-008', '1', '0', '1', '0', '', '2012-06-11 15:24:53', '2012-06-11 15:24:58', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1212', '934', '对焦模式（单点，动态，自动，3D）能不能快速设置？', '&ldquo;对焦模式&rdquo;可以设置在快捷键FN（镜头端手柄旁那个键）上，这样每次只要按住FN键+后置拨轮即可快速切换。', '', '已审阅', 'H6', '佳能PowerShot A640', '2', 'FAQ20120611-009', '1', '0', '0', '0', '', '2012-06-11 15:26:58', '2012-06-11 15:26:58', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1213', '933', 'AE-L和AF-L键怎么用？', '如果拍摄多为静物且只是为了完成重新构图的话,AF-S模式几乎可以代替AE-L/AE-F键,半快门对焦好不放,就可以重新构图,这时候不会再重新对焦 了.(但AF-C  AF-A模式下,即使不放快门键,你移动位置后还是会重新对焦.)至AF-S下半快门键锁不锁暴光,则在设置菜单的&quot;自动暴光锁定&quot;选项设置.选择开启的 话半按快门不放就是对焦暴光都锁定.<br />\r\n但是AE-L/AE-F是让你不必切换到AF-S模式在AF-C AF-A模式下都能随意锁定对焦或暴光.扩展功能在设置菜单的&quot;AE-L AF-L&quot;选项里设置,你可以看到AE-L AF-L功能非常强大,可以锁定闪光灯值,还可以配合副拨盘对操控对焦区域.', '', '已发布', 'H6', '尼康D80', '1', 'FAQ20120611-010', '1', '0', '0', '0', '', '2012-06-11 15:29:08', '2012-06-11 15:29:08', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1214', '933', '尼康D80无法变焦怎么办？', '<span style=\"font-family:SimSun;font-size:14px;\">  尼康D80无法实现变焦有三种可能，第一种可能是自动变焦没有开启，楼主你可以开启自动变焦。开启方法在镜头上有一个开关，只要般大A挡就可以了。要是还 不能变焦，那么就是机身变焦马达坏了。这个自己没发处理，只能送去客服维修了。因为，机身马达坏了就需要拆机了，自己是不能拆机的。楼主还是去当地客服维 修保险。</span>', '', '已审阅', 'H6', '尼康D80', '2', 'FAQ20120611-011', '1', '0', '0', '0', '', '2012-06-11 15:30:50', '2012-06-11 15:30:50', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1215', '938', '尼康A90机身带光学防抖吗', '<span style=\"font-family:SimSun;font-size:14px;\">尼康A90<span style=\"color: rgb(51, 51, 51); line-height: 24px; background-color: rgb(245, 248, 253); \">采用了最新的滤镜，成像效果更好，颜色更艳丽。可以很好的结局摩尔纹的影响。而且尼康A90相机是目前像素最高的一款全画幅单反相机，所有的设计方案也是最新型的。只不过现在这款相机才刚刚上市，要是想购买我建议还是耐心等待一段时间不叫好。</span></span>', '', '已审阅', 'H6', '尼康A90', '1', 'FAQ20120611-012', '1', '0', '0', '0', '', '2012-06-11 15:32:54', '2012-06-11 15:32:54', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1216', '932', 'SONY-DSC-T30如何删除全部照片？', '<pre class=\"reply-text mb10\" id=\"content-745366828\">\r\n1、相机有&ldquo;全部删除&rdquo;选项，按向导操作即可；\r\n2、将存储卡在相机上格式化（推荐）；\r\n3、将卡取出，通过读卡器用电脑删除或格式化（装入相机后，再用相机格式化一下。有些相机有这样的要求，否则影响拍照或录像）。</pre>', '', '已审阅', 'H6', 'SONY-DSC-T30', '4', 'FAQ20120611-013', '1', '0', '0', '0', '', '2012-06-11 15:36:07', '2012-06-11 15:36:07', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1232', '919', ' 惠普 4321s（XY389PA）设置了密码如何删除？', '接禁用hp protection 系统。', '', '已发布', 'H5', ' 惠普 4321s（XY389PA）', '1', 'FAQ20120611-014', '1', '0', '0', '0', '', '2012-06-11 16:15:24', '2012-06-11 16:15:24', '0', '0', '0');
INSERT INTO xm_faq VALUES ('1330', '921', '三星530U4B-S01散热效果怎么样？', '<pre id=\"content-935022554\" class=\"reply-text mb10\">\r\n三星530U4B-S01是涡轮风扇，散热效果很好。</pre>', '', '草稿', 'H5', '三星530U4B-S01', '1', 'FAQ20120612-015', '1', '0', '0', '0', '', '2012-06-12 11:47:28', '2012-06-12 11:47:28', '0', '0', '0');
